import './App.css';

function Header(){
  return <header>
    const imagePath = 'public/ecmark.png';
    <script src="app.js"></script>
    const imgElement = document.createElement('img');
    imgElement.src = imagePath;
    imgElement.alt = 'ECmark';
    document.body.appendChild(imgElement);

    <img src="public/ECmark.png" alt="ECmark"></img>
    <h1><a href="/">Endless Creation</a></h1>
  </header>
}

function Nav(){
  return <nav>
    <ul>

      <li><a href="/read/1">Home</a></li>
      <li><a href="/read/2">About Us</a></li>
      <li><a href="/read/3">Members</a></li>
      <li><a href="/read/4">Recruit</a></li>
    </ul>
  </nav>
}

function Article(){
  return <article>
    <h2>Welcome</h2>
    Hello, Web
  </article> 
}

function App() {
  return (
    <div>
      <Header></Header>
      <Nav></Nav>
      <Article></Article>
    </div>
  );
}

export default App;
